        <p>{this.props.greeting}</p>
        <div className='tl'>
        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Funsplash.com%2Fs%2Fphotos%2Fperson&psig=AOvVaw0t8dQvc3f63648gKwgarHK&ust=1701347656102000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCMDf9oac6YIDFQAAAAAdAAAAABAE" alt="Catherine Reed" />    

        </div>
        </div>
        );
   }
}

export default Hello;
